defs.value:
pub enum Error {
    Malformed(String),
    BadMagic(u64),
    Scroll(scroll::Error),
    IO(io::Error),
}

pub enum SymbolKind {
    Regular,
    Absolute,
    ThreadLocal,
    UnknownSymbolKind(Flag),
}

pub enum ExportInfo<'a> {
    Regular {
        address: u64,
        flags: Flag,
    },
    Reexport {
        lib: &'a str,
        lib_symbol_name: Option<&'a str>,
        flags: Flag,
    },
    Stub {
        stub_offset: scroll::Uleb128,
        resolver_offset: scroll::Uleb128,
        flags: Flag,
    },
}

pub enum Reexport<'a> {
    DLLName {
        export: &'a str,
        lib: &'a str,
    },
    DLLOrdinal {
        ordinal: usize,
        lib: &'a str,
    },
}

pub enum SyntheticImportLookupTableEntry<'a> {
    OrdinalNumber(u16),
    HintNameTableRVA((u32, HintNameTableEntry)),
}
